const CustomerProfile = (props) => {
 return (
    <React.Fragment>
    <p>{props.customerID}</p>
    <p>{props.customerEmail}</p>
    <p>props.customerPhone</p>
    <p>props.customerVIP</p>
    </React.Fragment>
 )
}

export default CustomerProfile;
